          <Modal.Footer>
            <Button onClick={this.handleClose}>Close</Button>
          </Modal.Footer>
        </Modal>
        </Col>
        <Col xs={4} md={1}>
         {'10:30am - 11:00am'}
        </Col>
        <Col xs={4} md={1}>
          {'11:00am - 11:30am'}
        </Col>
        <Col xs={4} md={1}>
